import React from "react";
import { observer } from "mobx-react-lite";
import { products } from "../../store/FoodList/FoodList";
import { Tbody } from "../TableForProducts/TableForProducts.css";
import { CountingKcalContainer, CountingKcalTextCont, TableCountingKcal } from "./CountingKcalComp.css";
import { Table } from "react-bootstrap";
import { H2Text } from "./Home.css";

const CountingKcalComp = observer(() => {

    return (
        <CountingKcalContainer>
            <CountingKcalTextCont><H2Text>Podsumowanie dodanych produktów</H2Text></CountingKcalTextCont>
            <Table striped bordered hover variant="dark" size="sm">
                <thead>
                    <tr>
                        <th>Kcal</th>
                        <th>Białko</th>
                        <th>Węglowodany</th>
                        <th>Tłuszcz</th>
                        <th>Gramy</th>
                    </tr>
                </thead>
                <tbody>
                    <tr>
                        <td>{products.kcal}</td>
                        <td>{products.proteins}</td>
                        <td>{products.carbs}</td>
                        <td>{products.fats}</td>
                        <td>{products.eaten}</td>
                    </tr>
                </tbody>
            </Table>
        </CountingKcalContainer>

    )
})

export default CountingKcalComp;
